item.description:
Es tan pequeño y discreto que lo más excitante que tiene es precisamente esa posibilidad de llevarlo contigo a cualquier parte. El huevo vibrador es un juguete erótico pensado para que la pasión pueda viajar más allá de las fronteras propias de la intimidad. Rompe moldes con este huevo con control remoto cuyos movimientos puedes programar en un radio de 5 metros de distancia a través del mando inalámbrico. Así, mientras llevas el huevo vibrador en la entrepierna, otra persona puede tomar la responsabilidad de decidir cuál es el momento más adecuado para que empieces a experimentar sus sensaciones.
 Longitud del vibrador: 7 cm;
 Diámetro: 3,2 cm;
 Batería: 2AAA
